impl fmt::Display for ChatLine {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        match self {
            ChatLine::Message { ts, msg } => {
                write!(f, "[{}] {}", ts.format("%H:%M:%S"), msg)
            }

            ChatLine::Transfer {
                ts,
                filename,
                done,
                total,
                direction,
                state,
                ..
            } => {
                let dir = match direction {
                    TransferDirection::Upload => "â†‘",
                    TransferDirection::Download => "â†“",
                };

                let st = match state {
                    TransferState::InProgress => "â€¦",
                    TransferState::Done => "âœ”",
                    TransferState::Failed => "âœ˜",
                };

                let bar = render_progress(*done, *total, 20);

                write!(
                    f,
                    "[{}] {} {} {} {}",
                    ts.format("%H:%M:%S"),
                    dir,
                    filename,
                    bar,
                    st
                )
            }
        }
    }
}

