/// Optional: derive multiple candidate ports for a period and select deterministically.
/// This function generates `candidates` 16-bit values from HKDF output and selects one
/// based on a simple index derived from `period_index` to further reduce collision
/// probability between different secrets.
pub fn derive_port_from_period_multiple(
	secret_bytes: &[u8],
	base_port: u16,
	port_range: u16,
	period_index: u64,
	candidates: usize, // e.g. 4
	) -> u16 {
	
	if port_range == 0 || candidates == 0 {
		return base_port;
	}


	// Enough bytes for `candidates * 2` (u16 per candidate); round up to 8-byte blocks for HKDF expand.
	let needed_bytes = candidates * 2;
	let mut okm = vec![0u8; needed_bytes];


	// Use period as salt and include a domain separation label with candidate count.
	let salt = period_index.to_be_bytes();
	let hk = Hkdf::<Sha256>::new(Some(&salt), secret_bytes);
	hk.expand(b"port-rotation-multi", &mut okm);
	// Build candidate u16s
	let mut candidate_ports = Vec::with_capacity(candidates);
	for chunk in okm.chunks_exact(2) {
		let val = u16::from_be_bytes([chunk[0], chunk[1]]);
		let offset = (val as u32 % port_range as u32) as u16;
		candidate_ports.push(base_port.wrapping_add(offset));
	}


	// Deterministic selection index derived from period_index to avoid introducing external randomness.
	let sel = (period_index as usize) % candidates;
	candidate_ports[sel]
}

/// Returns (port, handshake_string)
pub fn compute_port(
    secret_bytes: &[u8],
    base_port: u16,
    port_range: u16,
    trigger: &mut SystemTime,
    current_port: u16,
    first_run: &mut bool,
) -> (u16, String) {
    let elapsed = SystemTime::now()
        .duration_since(*trigger)
        .unwrap_or(Duration::from_secs(u64::MAX))
        .as_secs();

    if elapsed >= PORT_ROTATION_DELAY || *first_run {
        // Align everyone to the same even-numbered period window
		let now = SystemTime::now().duration_since(UNIX_EPOCH).unwrap().as_secs();
		let period = (now / HASH_PERIOD_SECS) & !1; // align to even period window
        let new_port = derive_port_from_period(secret_bytes, base_port, port_range, period);

        *trigger = SystemTime::now();
        *first_run = false;

        let handshake = HANDSHAKES
            .get(new_port as usize)
            .and_then(|b| String::from_utf8((*b).into()).ok())
            .unwrap_or_default();

        (new_port, handshake)
    } else {
        let handshake = HANDSHAKES
            .get(current_port as usize)
            .and_then(|b| String::from_utf8((*b).into()).ok())
            .unwrap_or_default();

        (current_port, handshake)
    }
}

/// Compute identical rotation ports for all peers by aligning period windows
pub fn compute_synched_ports(
    secret_bytes: &[u8],
    base_port: u16,
    port_range: u16,
    previous_periods: u64,
) -> Vec<u16> {
    let now = SystemTime::now()
        .duration_since(SystemTime::UNIX_EPOCH)
        .unwrap()
        .as_secs();

    // Align everyone to the same even-numbered period window
    let current_period = (now / HASH_PERIOD_SECS) & !1;

    (0..=previous_periods)
        .map(|offset| {
            let period = current_period.saturating_sub(offset);
            derive_port_from_period(secret_bytes, base_port, port_range, period)
        })
        .collect()
}

fn derive_key(password: &str) -> [u8; KEY_LEN] {
    // deterministically derive salt from password
    let mut hasher = Sha256::new();
    hasher.update(password.as_bytes());
    let hash = hasher.finalize();
    let salt = &hash[..SALT_LEN];

    // PBKDF2 with fixed salt to get 32-byte key
    let mut key = [0u8; KEY_LEN];
    pbkdf2::pbkdf2_hmac::<Sha256>(password.as_bytes(), salt, PBKDF2_ITERS, &mut key);
    key
}

fn derive_nonce(plaintext: &str) -> [u8; NONCE_LEN] {
    // deterministically derive nonce from plaintext
    let hash = Sha256::digest(plaintext.as_bytes());
    let mut nonce = [0u8; NONCE_LEN];
    nonce.copy_from_slice(&hash[..NONCE_LEN]);
    nonce
}

/// Deterministically derive a handshake from the shared secret and UDP port.
/// No precomputation or global array needed.
fn derive_handshake_for_port(secret_bytes: &[u8], port: u16) -> Handshake {
    let salt = port.to_be_bytes();
    let hk = Hkdf::<Sha256>::new(Some(&salt), secret_bytes);
    let mut pwd = [0u8; 32];
    let mut hs  = [0u8; 32];
    hk.expand(b"hs-password", &mut pwd).expect("HKDF expand pwd");
    hk.expand(b"hs-string", &mut hs).expect("HKDF expand hs");
    let password_b64 = general_purpose::URL_SAFE_NO_PAD.encode(pwd);
    let hs_b64       = general_purpose::URL_SAFE_NO_PAD.encode(hs);
    Handshake { password: password_b64, handshake_str: hs_b64 }
}

/// AES-GCM encrypt plaintext for a given port.
/// Returns base64-URL-safe ciphertext.
fn encrypt_for_port(
    secret_bytes: &[u8],
    target_port: u16,
    plaintext: &str,
) -> Result<String, aes_gcm::Error> {
    let hs = derive_handshake_for_port(secret_bytes, target_port);

    let key_bytes = derive_key(&hs.password);
    // Safe unwrap â€” key is always 32 bytes
    let cipher = Aes256Gcm::new_from_slice(&key_bytes).expect("32-byte AES key");
    let nonce_bytes = derive_nonce(&hs.handshake_str);
    let nonce = Nonce::from_slice(&nonce_bytes);

    let ciphertext = cipher.encrypt(nonce, plaintext.as_bytes())?;
    Ok(general_purpose::URL_SAFE_NO_PAD.encode(ciphertext))
}

/// Try decrypting a base64 string by checking current, previous, and next
/// rotation periods, each with its derived port handshake.


fn try_decrypt_string_with_window(
    secret_bytes: &[u8],
    base_port: u16,
    port_range: u16,
    ciphertext_b64: &str,
    local_port: u16,
    chat_tx: broadcast::Sender<ChatLine>,
) -> Option<String> {

    // --- Step 1: compute current adjusted period ---
    let now = SystemTime::now()
        .duration_since(UNIX_EPOCH)
        .ok()? 
        .as_secs() as i64;

    // apply global drift offset safely
    let drift = std::panic::catch_unwind(|| GLOBAL_DRIFT.load(Ordering::Relaxed))
        .ok()
        .unwrap_or(0);
    let adjusted_now = (now + drift).max(0) as u64;
    let current_period = (adjusted_now / HASH_PERIOD_SECS) & !1;

    // --- Step 2: prepare candidate ports ---
    let mut candidate_ports = Vec::new();
    candidate_ports.push(local_port);

    // --- Step 3: adaptive search ---
    let mut success: Option<String> = None;
    let mut window = 2; // initial Â±2
    for attempt in 0..3 {
        let mut ports_to_try = Vec::new();
        for delta in (-window..=window).step_by(2) {
            let period = (current_period as i64 + delta).max(0) as u64;
            let port = derive_port_from_period(secret_bytes, base_port, port_range, period);
            ports_to_try.push(port);
        }

        // include static local port once
        ports_to_try.push(local_port);

        for port in ports_to_try.iter().copied() {
            let hs = derive_handshake_for_port(secret_bytes, port);
            match decrypt_string(&hs.password, ciphertext_b64, &hs.handshake_str) {
                Ok(plaintext) => {
                    //ui_log!(chat_tx,
                    //    "[adaptive-decrypt] success: period={} drift={}s ports_tried={:?}",
                    //    current_period, drift, ports_to_try
                    //);
                    success = Some(plaintext);
                    break;
                }
                Err(_) => continue,
            }
        }

        if success.is_some() {
            break;
        } else {
            // Expand search window if first/second attempts fail
            window *= 2;
            ui_log!(chat_tx,
                "[adaptive-decrypt] expanding window to Â±{} (attempt {} drift={}s)",
                window, attempt + 1, drift
            );
        }
    }

    if success.is_none() {
        ui_log!(chat_tx,
            "[adaptive-decrypt] failed all attempts for period={} drift={}s local_port={} range={}",
            current_period, drift, local_port, port_range
        );
    }

    success
}


fn decrypt_string(password: &str, ciphertext_b64: &str, handshake: &str) -> Result<String, Box<dyn std::error::Error>> {
    let key_bytes = derive_key(password);
    let cipher = Aes256Gcm::new_from_slice(&key_bytes)
        .map_err(|_| "Invalid AES key length")?;

    let nonce_bytes = derive_nonce(handshake);
    let nonce = Nonce::from_slice(&nonce_bytes);

    // Decode ciphertext from Base64
    let ciphertext = general_purpose::URL_SAFE_NO_PAD
        .decode(ciphertext_b64)
        .map_err(|_| "Invalid base64 ciphertext")?;

    // Decrypt safely
    let plaintext = cipher
        .decrypt(nonce, ciphertext.as_ref())
        .map_err(|_| "AES-GCM decryption failed (bad key/nonce or tampered data)")?;

    // Convert UTF-8 bytes to String
    let result = String::from_utf8(plaintext)
        .map_err(|_| "Plaintext is not valid UTF-8")?;

    Ok(result)
}

