// -------------------- KEY HANDLING --------------------
async fn handle_key(
    key_event: KeyEvent,
    input_buffer: &mut String,
    chat: &ChatHistory,
    shared_socket: Arc<RwLock<Arc<UdpSocket>>>,
    targets: &Arc<Mutex<HashSet<SocketAddr>>>,
    redraw_notify: &Arc<Notify>,
    transfer_counter: &TransferCounter,
    history: &mut Vec<String>,
    history_index: &mut Option<usize>,
    search_mode: &mut bool,
    search_buffer: &mut String,
    search_result_index: &mut Option<usize>,
    scroll_offset: &mut usize,
    visible_rows: usize,
    targets_clone_for_send: Arc<Mutex<HashSet<SocketAddr>>>,
    ack_map: Arc<DashMap<u32, Arc<Mutex<FileAck>>>>,
    secret: String,
    progress_registry: Arc<ProgressRegistry>,
    channel_registry: AckChannelRegistry,
    chat_tx: broadcast::Sender<ChatLine>,
) {
    match key_event.code {
        KeyCode::Char('r') if key_event.modifiers.contains(KeyModifiers::CONTROL) => {
            *search_mode = true;
            *search_buffer = String::new();
            *search_result_index = None;
        }

        KeyCode::Char(c) => {
            if *search_mode {
                search_buffer.push(c);
                *search_result_index =
                    history.iter().rposition(|entry| entry.contains(&*search_buffer));
                if let Some(idx) = *search_result_index {
                    *input_buffer = history[idx].clone();
                }
            } else {
                input_buffer.push(c);
                *history_index = None;
            }
        }

        KeyCode::Backspace => {
            if *search_mode {
                search_buffer.pop();
                *search_result_index =
                    history.iter().rposition(|entry| entry.contains(&*search_buffer));
                if let Some(idx) = *search_result_index {
                    *input_buffer = history[idx].clone();
                } else {
                    input_buffer.clear();
                }
            } else {
                input_buffer.pop();
                *history_index = None;
            }
        }

        KeyCode::Enter => {
            if *search_mode {
                *search_mode = false;
                *search_buffer = String::new();
                *search_result_index = None;
            } else if !input_buffer.trim().is_empty() {
                let input = input_buffer.clone();
                input_buffer.clear();
                history.push(input.clone());
                *history_index = None;

                if input.starts_with("/send ") {
                    let path = input[6..].trim().to_string();

                    // file_id: a simple hash (not cryptographic)
					let file_id = {
						use std::hash::{Hash, Hasher};
						let mut hasher = std::collections::hash_map::DefaultHasher::new();
						path.hash(&mut hasher);
						(hasher.finish() & 0xFFFF_FFFF) as u32
					};

                    // Clone state needed for the async task
                    let shared_socket_clone = shared_socket.clone();
                    let targets_clone = targets_clone_for_send.clone();
                    let ack_map_clone = ack_map.clone();
                    let path_clone = path.clone();
                    let chat_tx_send_file = chat_tx.clone();

                    tokio::spawn(async move {
                        if let Err(e) = send_file(
                            shared_socket_clone,
                            targets_clone,
                            path_clone,
                            file_id,
                            ack_map_clone,
                            channel_registry,
                            progress_registry,
                            chat_tx,
                        )
                        .await
                        {
                            ui_log!(chat_tx_send_file,"Failed to send file: {}", e);
                        }
                    });
					
                } else if input.starts_with("/quit") {
                    let _ = disable_raw_mode();
                    let mut stdout = stdout();
                    let _ = execute!(stdout, Clear(ClearType::All), cursor::MoveTo(0, 0));
                    std::process::exit(0);
                } else {
                    let targets_lock = targets.lock().await;
                    for &addr in targets_lock.iter() {
						let target_port = addr.port();

						// Encrypt outgoing message for this target
						let encrypted = match encrypt_for_port(secret.as_bytes(), target_port, &input) {
							Ok(ct) => ct,
							Err(e) => {
								ui_log!(chat_tx,"[ERROR] encrypting message for {} failed: {}", addr, e);
								continue;
							}
						};

						// --- Unified Framed Message ---
						let msg_bytes = encrypted.as_bytes();
						let period = current_period_u32();
						let seq = CHAT_SEQ.fetch_add(1, Ordering::Relaxed);

						let mut frame = Vec::with_capacity(16 + msg_bytes.len());
						write_header(&mut frame, Kind::Chat, period, seq, msg_bytes.len() as u32);
						frame.extend_from_slice(msg_bytes);

						if let Err(e) = send_via_shared(&shared_socket, &frame, addr).await {
							ui_log!(chat_tx,"[WARN] failed to send to {}: {}", addr, e);
						} else {
							/*ui_log!(chat_tx,
								"[TERMINAL-SEND] to {} period={} seq={} bytes={}",
								addr,
								period,
								seq,
								msg_bytes.len()
							);*/
						}
					}

					// Push chat UI message
					chat_push_cap(
						chat,
						ChatLine::Message {
							ts: Local::now(),
							msg: format!("You: {}", input),
						},
					)
					.await;
					
					redraw_notify.notify_one();
				}
            }
        }

        KeyCode::Up => {
            if !*search_mode {
                if let Some(idx) = history_index {
                    if *idx > 0 {
                        *idx -= 1;
                        *input_buffer = history[*idx].clone();
                    }
                } else if !history.is_empty() {
                    *history_index = Some(history.len() - 1);
                    *input_buffer = history.last().unwrap().clone();
                }
            }
        }

        KeyCode::Down => {
            if !*search_mode {
                if let Some(idx) = history_index {
                    if *idx + 1 < history.len() {
                        *idx += 1;
                        *input_buffer = history[*idx].clone();
                    } else {
                        *history_index = None;
                        input_buffer.clear();
                    }
                }
            }
        }

        KeyCode::PageUp => {
            *scroll_offset += visible_rows / 2;
        }

        KeyCode::PageDown => {
            *scroll_offset = scroll_offset.saturating_sub(visible_rows / 2);
        }

        KeyCode::Esc => {
            if *search_mode {
                *search_mode = false;
                *search_buffer = String::new();
                *search_result_index = None;
            } else {
                input_buffer.clear();
            }
        }

        _ => {}
    }

    if *scroll_offset == 0 {
        redraw_notify.notify_one();
    }
}



// -------------------- FILE MANAGER TASK --------------------
async fn file_manager_task(
    mut rx: mpsc::Receiver<FileChunk>,
    chat_tx: broadcast::Sender<ChatLine>,
    file_transfers: FileTransfers,
    transfer_counter: TransferCounter,
    redraw_notify: Arc<Notify>,
    ack_tracker: FileAckTracker,
    forward_cache: ForwardCache,
    registry: Arc<ProgressRegistry>,
) {
	
    let state: Arc<Mutex<HashMap<u32, FileState>>> = Arc::new(Mutex::new(HashMap::new()));
    let completed_files: Arc<RwLock<HashSet<u32>>> = Arc::new(RwLock::new(HashSet::new()));
    let mut last_redraw = Instant::now();

    loop {
        match rx.recv().await {
            Some(chunk) => {
                let file_id = chunk.file_id;
                //ui_log!(chat_tx,
                //    "[FM] chunk={} total={:?} file_id={}",
                //    chunk.chunk_index,
                //    chunk.total_chunks,
                //    file_id
                //);

                // --- Skip if already completed ---
                {
                    let completed_guard = completed_files.read().await;
                    if completed_guard.contains(&file_id) {
                        continue;
                    }
                }

                // --- Determine filename (or fallback) ---
                let filename: String = {
                    let map_lock = registry.map.lock().await;
                    if let Some(name) = map_lock.get(&file_id) {
                        name.filename.clone()
                    } else {
                        format!("file_{}", file_id)
                    }
                };

                // --- Insert or update FileState ---
                let mut state_guard = state.lock().await;
                let entry = state_guard.entry(file_id).or_insert_with(|| FileState {
                    filename: filename.clone(),
                    total_chunks: chunk.total_chunks,
                    chunks: HashMap::new(),
                    last_seen: Instant::now(),
                });
                entry.last_seen = Instant::now();

                /// --- Ensure total_chunks is initialized ---
				if entry.total_chunks == 0 && chunk.total_chunks > 0 {
					entry.total_chunks = chunk.total_chunks;
				}
				
                if let Some(name) = &chunk.filename {
                    if entry.filename.starts_with("file_") || entry.filename != *name {
                        entry.filename = name.clone();
                        //ui_log!(chat_tx,"[FM] filename resolved to '{}'", name);
                    }
                }

                // --- Skip duplicate chunks ---
                if entry.chunks.contains_key(&chunk.chunk_index) {
                    drop(state_guard);
                    continue;
                }

                // --- Store payload ---
                entry
                    .chunks
                    .insert(chunk.chunk_index, chunk.payload.clone());

                // Snapshot for checks after unlock
                let unique_received = entry.chunks.len() as u64;
                let total_chunks_opt = entry.total_chunks;
                let filename_known = !entry.filename.starts_with("file_");
                let file_chunks_clone = entry.chunks.clone();
                let filename_for_write = entry.filename.clone();


                // --- Explicit completion trigger when all expected chunks received ---
				if entry.total_chunks > 0 && unique_received as u64 == entry.total_chunks {
					//ui_log!(chat_tx,
					//	"[FM] file_id={} all {} chunks received, triggering finalization",
					//	file_id, entry.total_chunks
					//);

					let mut cf = completed_files.write().await;
					if !cf.contains(&file_id) {
						cf.insert(file_id);
						drop(cf);

						// clone data for async spawn to avoid ownership moves
						let filename_for_spawn = filename_for_write.clone();
						let file_chunks_for_spawn = file_chunks_clone.clone();
						let file_transfers = file_transfers.clone();
						let chat_tx_clone = chat_tx.clone();
						let redraw_notify = redraw_notify.clone();

						tokio::spawn(async move {
							// inner clone for blocking thread
							let file_chunks_for_blocking = file_chunks_for_spawn.clone();
							let filename_for_blocking = filename_for_spawn.clone();

							let write_result = tokio::task::spawn_blocking(move || {
								let total_size: usize = file_chunks_for_blocking.values().map(|c| c.len()).sum();
								let mut data = Vec::with_capacity(total_size);
								for i in 0..file_chunks_for_blocking.len() as u64 {
									if let Some(c) = file_chunks_for_blocking.get(&i) {
										data.extend_from_slice(c);
									}
								}
								std::fs::write(&filename_for_blocking, &data)
							})
							.await;

							if write_result.is_ok() {
								let _ = chat_tx_clone.send(ChatLine::Message {
									ts: chrono::Local::now(),
									msg: format!("Saved received file '{}'", filename_for_spawn),
								});
								
								redraw_notify.notify_one();

								let mut ft = file_transfers.lock().await;
								ft.insert(
									filename_for_spawn.clone(),
									(
										file_chunks_for_spawn.len() as u64,
										file_chunks_for_spawn.len() as u64,
										TransferDirection::Download,
										TransferState::Done,
									),
								);
								redraw_notify.notify_one();
							}
						});
					}
				}
				
				
				//ui_log!(chat_tx,
				//	"[FM][CHK] fid={} have={} expected={}",
				//	file_id, unique_received, entry.total_chunks
				//);
				
				drop(state_guard);


                // --- Update ACK tracker (optional) ---
                if let Some(_src) = &chunk.src {
                    let mut at = ack_tracker.lock().await;
                    at.entry(filename_for_write.clone());
                }

                // --- Redraw UI periodically ---
                if last_redraw.elapsed() >= Duration::from_millis(100) {
                    redraw_notify.notify_one();
                    last_redraw = Instant::now();
                }
			}

            None => {
				// channel closed or all senders dropped
				ui_log!(chat_tx,"[FM] channel closed â€” exiting");
				break;
			}
        }
    }
}

fn chunks_needed(file_size: u64, chunk_size: u64) -> Result<u64, &'static str> {
    if chunk_size == 0 {
        return Err("chunk_size must be > 0");
    }
    let cs = u64::from(chunk_size);

    // ceil_div(file_size, cs) without overflow
    let n = file_size / cs + u64::from(file_size % cs != 0);

    u64::try_from(n).map_err(|_| "too many chunks (> u64::MAX)")
}

pub async fn send_file(
    shared_socket: Arc<RwLock<Arc<UdpSocket>>>,
    targets: Arc<tokio::sync::Mutex<HashSet<SocketAddr>>>,
    path: String,
    file_id: u32,
    ack_map: AckMap,
    channel_registry: AckChannelRegistry,
    _registry: Arc<ProgressRegistry>,
    chat_tx: broadcast::Sender<ChatLine>,
) -> anyhow::Result<()> {
    use std::{
        collections::{HashMap, HashSet},
        net::SocketAddr,
        sync::atomic::{AtomicU64, Ordering},
        time::{Duration, Instant},
    };
    use bytes::Bytes;
    use dashmap::DashMap;
    use futures::FutureExt; // for .catch_unwind()
    use tokio::{io::AsyncReadExt, sync::{mpsc, Notify}};

    // ---- Tunables ----
    const CHUNK: usize         = 1200;   // keep < MTU
    const INITIAL_CWND: u32    = 8;
    const MAX_CWND: u32        = 512;
    const ACK_TIMEOUT: u64     = 120;    // ms for per-chunk timeout
    const TICK_US: u64         = 2000;   // pacer tick: 2ms (prevents UI starvation)
    const MAX_RETRIES: usize   = 25;     // per-chunk retry ceiling per peer
    const STALL_MS: u64        = 10_000; // watchdog: no progress for 10s => free exhausted peers

    static PROGRESS_TICKS: AtomicU64 = AtomicU64::new(0);

    // Minimal crash visibility without relying on RUST_BACKTRACE
    std::panic::set_hook(Box::new(|info| {
        let _ = eprintln!("\n>>> PANIC in send_file: {info:?}");
    }));
    
    // Open once (async) for size
    let mut f_async = tokio::fs::File::open(&path).await?;
    let meta = f_async.metadata().await?;
    let file_size = meta.len();
    drop(f_async);
    let std_file = std::fs::File::open(&path)?; // for read_at
    
    let filename = std::path::Path::new(&path).to_string_lossy().to_string();
    ui_log!(chat_tx,"[SEND][START] file_id={} name={} size={} bytes", file_id, filename, file_size);


    // Snapshot peers
    let clients: Vec<SocketAddr> = {
        let t = targets.lock().await;
        t.iter().copied().collect()
    };

    let total_chunks = chunks_needed(file_size, CHUNK as u64)
        .expect("filesize/chunk math failed");
    let transfer_token: u64 = rand::random();

    // Register FileAck tracking for progress/mapping (UI)
    if !clients.is_empty() {
        let fa = FileAck::with_token_and_peers(transfer_token, &clients, total_chunks);
        ack_map.insert(file_id, Arc::new(Mutex::new(fa)));
    }

    // Per-transfer ACK channel in registry
    //let (ack_tx, mut ack_rx) = mpsc::channel::<AckPacket>(8192);
    //{
    //    let mut reg = channel_registry.write().await;
    //    reg.insert(file_id, ack_tx.clone());
    //}
    //ui_log!(chat_tx, "[DEBUG] Registered ack_tx for file_id {}", file_id);

    // On-demand encoder (no large buffers)
    #[cfg(unix)]
    use std::os::unix::fs::FileExt;

    async fn encode_chunk_on_demand(
        std_file: &std::fs::File,
        file_id: u32,
        transfer_token: u64,
        total_chunks: u64,
        filename: &str,
        idx: u64,
        chunk_size: usize,
        local_addr: SocketAddr,
    ) -> std::io::Result<Bytes> {
        use std::io::{Read, Seek, SeekFrom};
        let offset = idx * (chunk_size as u64);
        let f = std_file.try_clone()?; // clone handle for blocking read
        let (buf, n): (Vec<u8>, usize) = tokio::task::spawn_blocking(move || {
            let mut buf = vec![0u8; chunk_size];
            #[cfg(unix)]
            {
                let n = f.read_at(&mut buf, offset)?;
                Ok::<_, std::io::Error>((buf, n))
            }
            #[cfg(not(unix))]
            {
                let mut g = f;
                g.seek(SeekFrom::Start(offset))?;
                let n = g.read(&mut buf)?;
                Ok::<_, std::io::Error>((buf, n))
            }
        })
        .await
        .map_err(|e| std::io::Error::new(std::io::ErrorKind::Other, format!("join err: {e}")))??;

        let payload = buf[..n].to_vec();
        let fc = FileChunk {
            file_id,
            chunk_index: idx,
            transfer_token,
            total_chunks,
            filename: Some(filename.to_string()),
            payload,
            src: Some(local_addr),
        };
        Ok(Bytes::from(fc.to_bytes()))
    }

    // Wrap encoded FileChunk bytes with protocol header and send
    async fn send_framed_chunk(
        shared_socket: &Arc<RwLock<Arc<UdpSocket>>>,
        peer: SocketAddr,
        encoded_chunk: &[u8],
    ) -> std::io::Result<()> {
        let period = current_period_u32();
        let seq = FILE_SEQ.fetch_add(1, std::sync::atomic::Ordering::Relaxed);

        let mut frame = Vec::with_capacity(16 + encoded_chunk.len());
        write_header(&mut frame, Kind::FileChunk, period, seq, encoded_chunk.len() as u32);
        frame.extend_from_slice(encoded_chunk);

        let sock = {
            let guard = shared_socket.read().await;
            guard.clone()
        };
        sock.send_to(&frame, peer).await?;
        Ok(())
    }

    // Per-peer send window
    #[derive(Clone)]
    struct SendWindow {
        next_to_send: u64,
        cwnd: u32,
        ssthresh: u32,
        in_flight: u32,
        unacked: HashSet<u64>,
        last_sent: HashMap<u64, Instant>,
        retries: HashMap<u64, usize>,
    }
    impl SendWindow {
        fn new(total: u64) -> Self {
            let mut un = HashSet::with_capacity(total as usize);            
            for i in 0..total { un.insert(i); }
            Self {
                next_to_send: 0,
                cwnd: INITIAL_CWND,
                ssthresh: 64,
                in_flight: 0,
                unacked: un,
                last_sent: HashMap::new(),
                retries: HashMap::new(),
            }
        }
        fn all_done(&self) -> bool { self.unacked.is_empty() }
    }

    // Track send state
    let windows: Arc<DashMap<(u32, SocketAddr), SendWindow>> = Arc::new(DashMap::new());
    for &peer in &clients { windows.insert((file_id, peer), SendWindow::new(total_chunks)); }

    // Notify to wake pacer on events (ACKs/timeouts)
    let notify = Arc::new(Notify::new());

    // ---- Robust ACK loop (panic-guarded) ----
    
		// Per-transfer ACK channel in registry
		let (ack_tx, _) = broadcast::channel::<AckPacket>(8192);
		
		let mut reg = channel_registry.write().await;
		reg.insert(file_id, ack_tx.clone());
		
		let mut ack_rx = ack_tx.subscribe();
		
        let windows_clone = windows.clone();
        let ack_map_clone = ack_map.clone();
        let notify_ack = notify.clone();
        let chat_tx_clone = chat_tx.clone();
        
        tokio::spawn(async move {
			let chat_tx_clone_error = chat_tx_clone.clone();
			let task = async move {
				loop {
						match ack_rx.recv().await {
							Ok(ack) => {
								let mut credited = false;

								// Fast path: exact window
								if let Some(mut w) = windows_clone.get_mut(&(ack.file_id, ack.src)) {
									let win = w.value_mut();
									//ui_log!(chat_tx_clone, "[DEBUG] [SEND-WINDOW] found peer={} for exact ack.src", ack.src);
									if win.unacked.remove(&ack.chunk_index) {
										if win.in_flight > 0 { win.in_flight -= 1; }
										if win.cwnd < MAX_CWND { win.cwnd += 1; }
										win.last_sent.remove(&ack.chunk_index);
										win.retries.remove(&ack.chunk_index);
										credited = true;
									} else {
										ui_log!(chat_tx_clone, "[DEBUG][SEND-WINDOW] chunk={} not in unacked!", ack.chunk_index);
									}
								}

								// Fallback: any window still tracking this chunk for the file
								if !credited {
									ui_log!(chat_tx_clone, "[DEBUG] [ACK] chunk {} not found in any send window", ack.chunk_index);
									if let Some(mut any_w) = windows_clone.iter_mut().find(|entry| {
										let (fid, _) = *entry.key();
										fid == ack.file_id && entry.value().unacked.contains(&ack.chunk_index)
									}) {
										let peer = any_w.key().1;
										let win = any_w.value_mut();
										if win.unacked.remove(&ack.chunk_index) {
											if win.in_flight > 0 { win.in_flight -= 1; }
											if win.cwnd < MAX_CWND { win.cwnd += 1; }
											win.last_sent.remove(&ack.chunk_index);
											win.retries.remove(&ack.chunk_index);
											ui_log!(chat_tx_clone,"[ACK][FALLBACK] file={} chunk={} used peer={} (ack.src={})",
													  ack.file_id, ack.chunk_index, peer, ack.src);
											credited = true;
										}
									}
								}

								if credited {
									PROGRESS_TICKS.fetch_add(1, Ordering::Relaxed);
								} else {
									ui_log!(chat_tx_clone,"[ACK][NO-WINDOW] file={} chunk={} ack.src={}", ack.file_id, ack.chunk_index, ack.src);
								}

								if let Some(fa) = ack_map_clone.get(&ack.file_id) {
									let mut fa_locked = fa.lock().await;
									fa_locked.acknowledge(ack.src, ack.chunk_index);
								}

								notify_ack.notify_one();
							}
						Err(e) => {
							ui_log!(chat_tx_clone, "[ACK][ERR] recv failed: {:?}", e);
							break; // or retry, depending on logic
						}
					}
				}
			};

			if let Err(e) = std::panic::AssertUnwindSafe(task).catch_unwind().await {
				ui_log!(chat_tx_clone_error,"[SEND][PANIC] ACK loop panicked: {:?}", e);
			}
		});
    

    // ---- Pacer + timeout/resend loop (panic-guarded) ----
    
        let windows_clone_pacer = windows.clone();
        let filename_clone = filename.clone();
        let notify_pacer = notify.clone();
        let std_file = std_file.try_clone()?;
        let shared_socket = shared_socket.clone();
        let clients = clients.clone();
        let chat_tx_for_pacer = chat_tx.clone();

        tokio::spawn(async move {
			let chat_tx_for_pacer_clone = chat_tx_for_pacer.clone();
            let task = async move {
                let mut tick = tokio::time::interval(Duration::from_micros(TICK_US));
                let timeout = Duration::from_millis(ACK_TIMEOUT);

                loop {
                    tokio::select! {
                        _ = tick.tick() => {},
                        _ = notify_pacer.notified() => {},
                    }
                    
                    /*for e in windows.iter() {
						let (fid, peer) = *e.key();
						if fid != file_id { continue; }

						let win = e.value();
						if !win.unacked.is_empty() {
							ui_log!(chat_tx,
								"[SEND][PENDING] peer={} remaining={:?}",
								peer,
								{
									let mut unacked: Vec<_> = win.unacked.iter().copied().collect();
									unacked.sort_unstable();
									unacked
								}
							);
						}
					}*/

                    // If everyone finished, we can stop
                    let done = windows_clone_pacer.iter().all(|e| {
                        let (fid, _) = *e.key();
                        fid != file_id || e.value().all_done()
                    });
                    if done { break; }

                    // Snapshot local addr once per loop (for encode metadata)
                    let local_addr = {
                        let sock = {
                            let guard = shared_socket.read().await;
                            guard.clone()
                        };
                        match sock.local_addr() { Ok(a) => a, Err(_) => continue }
                    };

                    for &peer in &clients {
                        // entry may be missing if it was cleared earlier; skip safely
                        let entry_opt = windows_clone_pacer.get_mut(&(file_id, peer));
                        if entry_opt.is_none() { continue; }
                        let mut e = entry_opt.unwrap();

                        let win = e.value_mut();

                        // 1) Handle timeouts â†’ MD, allow resend by clearing last_sent
                        let timed_out: Vec<u64> = win.unacked.iter()
                            .filter_map(|&idx| {
                                win.last_sent.get(&idx)
                                    .and_then(|ts| (ts.elapsed() >= timeout).then_some(idx))
                            })
                            .collect();

                        for idx in timed_out {
                            // Multiplicative decrease
                            win.ssthresh = (win.cwnd / 2).max(INITIAL_CWND);
                            win.cwnd = INITIAL_CWND;

                            // allow resend
                            win.last_sent.remove(&idx);

                            let r = win.retries.entry(idx).or_insert(0);
                            *r += 1;
                            if *r > MAX_RETRIES {
                                // give up for this peer/chunk
                                win.unacked.remove(&idx);
                                if win.in_flight > 0 { win.in_flight -= 1; }
                                ui_log!(chat_tx_for_pacer,"[SEND][DROP] fid={} idx={} peer={} (max retries)", file_id, idx, peer);
                            } else {
                                // opportunistic immediate resend (do not change in_flight)
                                match encode_chunk_on_demand(
                                    &std_file, file_id, transfer_token, total_chunks, &filename, idx, CHUNK, local_addr
                                ).await {
                                    Ok(encoded) => {
                                        if let Err(e) = send_framed_chunk(&shared_socket, peer, &encoded).await {
                                            ui_log!(chat_tx_for_pacer,"[SEND][RESEND] fid={} idx={} peer={} err={:?}", file_id, idx, peer, e);
                                        } else {
                                            win.last_sent.insert(idx, Instant::now());
                                        }
                                    }
                                    Err(e) => { ui_log!(chat_tx_for_pacer,"[SEND][ENCODE-RESEND] fid={} idx={} err={:?}", file_id, idx, e); },
                                }
                            }
                        }

                        // 2) Fresh sends within budget
                        let budget = win.cwnd.saturating_sub(win.in_flight);
                        if budget == 0 { continue; }

                        let mut injected = 0u32;
                        let mut idx = win.next_to_send;

                        while injected < budget && idx < total_chunks {
                            if win.unacked.contains(&idx) && !win.last_sent.contains_key(&idx) {
                                match encode_chunk_on_demand(
                                    &std_file, file_id, transfer_token, total_chunks, &filename, idx, CHUNK, local_addr
                                ).await {
                                    Ok(encoded) => {
                                        if let Err(e) = send_framed_chunk(&shared_socket, peer, &encoded).await {
                                            ui_log!(chat_tx_for_pacer,"[SEND][FRESH] fid={} idx={} peer={} err={:?}", file_id, idx, peer, e);
                                        } else {
                                            win.in_flight += 1;
                                            win.last_sent.insert(idx, Instant::now());
                                            injected += 1;
                                        }
                                    }
                                    Err(e) => { ui_log!(chat_tx_for_pacer,"[SEND][ENCODE] fid={} idx={} err={:?}", file_id, idx, e); },
                                }
                            }
                            idx += 1;
                        }
                        win.next_to_send = win.next_to_send.max(idx);
                        tokio::task::yield_now().await; // yield after peer batch
                    }
                    // cooperative yield each tick
                    tokio::task::yield_now().await; // yield at end of pacer tick
                }
            };

            if let Err(e) = std::panic::AssertUnwindSafe(task).catch_unwind().await {
                ui_log!(chat_tx_for_pacer_clone,"[SEND][PANIC] pacer loop panicked: {:?}", e);
            }
        });
    

    // ---- Wait until ALL peers finished (with stall watchdog; no borrow conflicts) ----
    let mut last_tick = PROGRESS_TICKS.load(Ordering::Relaxed);
    let mut last_progress = Instant::now();

    loop {
		
        let all_done = windows.iter().all(|e| {
            let (fid, _) = *e.key();
            fid != file_id || e.value().all_done()
        });

        if all_done {
            ui_log!(chat_tx,"[SEND][DONE] file_id={} total_chunks={} (upload complete)", file_id, total_chunks);
            let _ = chat_tx.send(ChatLine::Transfer {
                ts: chrono::Local::now(),
                id: file_id,
                filename: filename_clone,
                done: total_chunks,
                total: total_chunks,
                direction: TransferDirection::Upload,
                state: TransferState::Done,
            });
            break;
        }

        // progress watchdog
        let tick = PROGRESS_TICKS.load(Ordering::Relaxed);
        if tick != last_tick {
            last_tick = tick;
            last_progress = Instant::now();
        } else if last_progress.elapsed() > Duration::from_millis(STALL_MS) {
            // free peers that exhausted retries for all remaining chunks
            for mut e in windows.iter_mut() {
                let peer = e.key().1; // capture key BEFORE mutable borrow of value
                let win = e.value_mut();
                let hopeless = win.unacked.iter().all(|idx| {
                    win.retries.get(idx).copied().unwrap_or(0) >= MAX_RETRIES
                });
                if hopeless {
                    ui_log!(chat_tx,"[SEND][PEER-DONE-NO-ACK] file={} peer={} (exhausted retries)", file_id, peer);
                    win.unacked.clear();
                    win.in_flight = 0;
                }
            }
            last_progress = Instant::now();
        }

        tokio::time::sleep(Duration::from_millis(100)).await;
        tokio::task::yield_now().await; // yield in wait loop
    }

    // Cleanup
    
        let mut reg = channel_registry.write().await;
        reg.remove(&file_id);
    
    ack_map.remove(&file_id);

    Ok(())
}



/// Sends using the currently active UDP socket from the rotation manager.
async fn send_via_shared(
    shared_socket: &Arc<RwLock<Arc<UdpSocket>>>,
    buf: &[u8],
    addr: SocketAddr,
) -> std::io::Result<usize> {
    let sock = { shared_socket.read().await.clone() };
    sock.send_to(buf, addr).await
    //ui_log!(chat_tx,"SENT-->{:?}",String::from_utf8_lossy(buf));
    //Ok(buf.len())
}


// -------------------- RECEIVER --------------------
async fn spawn_receiver(
    shared_socket: Arc<RwLock<Arc<UdpSocket>>>,
    chat_tx: broadcast::Sender<ChatLine>,
    file_chunk_tx: mpsc::Sender<FileChunk>,
    ack_map: Arc<DashMap<u32, Arc<Mutex<FileAck>>>>,
    progress_registry: Arc<ProgressRegistry>,
    targets: Arc<Mutex<HashSet<SocketAddr>>>,
    targets_tx: broadcast::Sender<SocketAddr>,
    server_mode: bool,
    forward_cache: ForwardCache,
    secret: String,
    shutdown_flag: Arc<AtomicBool>,
    channel_registry: AckChannelRegistry,
    mut udp_packet_rx: mpsc::Receiver<UdpPacket>,
    base_port: u16,
    port_range: u16,
) {
    while let Some(packet) = udp_packet_rx.recv().await {
        
        // --- Try unified frame header first ---
        if let Ok((hdr, payload)) = parse_header(&packet.payload) {
            match hdr.kind {
               x if x == Kind::Hello as u8 => {
					let src = packet.src;
					update_targets(src, &targets, &targets_tx, server_mode).await;

					// --- Send framed HELLO-ACK response ---
					let period = current_period_u32();
					let seq = FILE_SEQ.fetch_add(1, Ordering::Relaxed);
					let mut frame = Vec::with_capacity(16);
					write_header(&mut frame, Kind::HelloAck, period, seq, 0);

					if let Err(e) = send_via_shared(&shared_socket, &frame, src).await {
						ui_log!(chat_tx,"[HELLO] failed to send framed ACK to {}: {:?}", src, e);
					} else {
						//ui_log!(chat_tx,"[HELLO] ACK sent to {} period={} seq={}", src, period, seq);
					}

					continue;
				}

                x if x == Kind::Chat as u8 => {
					let (hdr, payload) = parse_header(&packet.payload).expect("Couldn't PARSE header frame");
					let mut pkt = packet.clone();
					pkt.payload = payload.to_vec();
					let src = packet.src;
                    try_handle_chat(
                        pkt,
                        src,
                        &chat_tx,
                        shared_socket.clone(),
                        &targets,
                        server_mode,
                        secret.clone(),
                        base_port,
                        port_range,
                    ).await;
                    continue;
                }

                x if x == Kind::FileAck as u8 => {
					let (hdr, payload) = parse_header(&packet.payload).expect("Couldn't PARSE header frame");
					let mut pkt = packet.clone();
					pkt.payload = payload.to_vec();
					let src = packet.src;
                    try_handle_ack(
                        pkt,
                        src,
                        ack_map.clone(),
                        channel_registry.clone(),
                        progress_registry.clone(),
                        shared_socket.clone(),
                        &targets,
                        chat_tx.clone(),
                    ).await;
                    continue;
                }

                x if x == Kind::FileChunk as u8 => {
					let (hdr, payload) = parse_header(&packet.payload).expect("Couldn't PARSE header frame");
					let mut pkt = packet.clone();
					pkt.payload = payload.to_vec();
					let src = packet.src;
                    try_handle_file_chunk(
						pkt,
						src,
						shared_socket.clone(),
						&file_chunk_tx,
						server_mode,
						&progress_registry,
						&forward_cache,
						&ack_map,
						&targets,
						chat_tx.clone(),
					).await;
                    continue;
                }
                
                x if x == Kind::HelloAck as u8 => {
                    let src = packet.src;
					update_targets(src, &targets, &targets_tx, server_mode).await;
                    continue;
                }

                _ => {
					let src = packet.src;
                    ui_log!(chat_tx,"[RECV] unknown frame kind={} from {}", hdr.kind, src);
                    continue;
                }
            }
		} else {
			// DISCARDED PACKET.
		}
    }
}







// ---------------- Helper functions ----------------

// -------------------- TARGET UPDATE --------------------
async fn update_targets(
    src: SocketAddr,
    targets: &Arc<Mutex<HashSet<SocketAddr>>>,
    targets_tx: &broadcast::Sender<SocketAddr>,
    server_mode: bool,
) {
    if server_mode {
        // Add new client if in server mode
        let mut t = targets.lock().await;
        if !t.contains(&src) {
            t.insert(src);
            //ui_log!(chat_tx,"[TARGETS] added new peer {:?}", src);
        }

    } else {
        // In client mode, only keep the latest sender
        let mut t = targets.lock().await;
        if !t.contains(&src) {
            t.clear();
            t.insert(src);
        }
    }

    // Notify via channel (non-blocking);
    let _ = targets_tx.send(src);
}


// -------------------- HANDLERS (Unified Framing with Debug) --------------------

pub async fn try_handle_chat(
    packet: UdpPacket,
    src: SocketAddr,
    chat_tx: &broadcast::Sender<ChatLine>,
    shared_socket: Arc<RwLock<Arc<UdpSocket>>>,
    targets: &Arc<Mutex<HashSet<SocketAddr>>>,
    server_mode: bool,
    secret: String,
    base_port: u16,
    port_range: u16,
) -> bool {
    
    let secret_bytes = secret.as_bytes();
    let local_port = {
        let sock = shared_socket.read().await.clone();
        sock.local_addr().unwrap_or_else(|_| "0.0.0.0:0".parse().unwrap()).port()
    };

    let decrypted = match std::str::from_utf8(&packet.payload)
        .ok()
        .and_then(|s| try_decrypt_string_with_window(secret_bytes, base_port, port_range, s, local_port, chat_tx.clone()))
    {
        Some(text) => text,
        None => {
            ui_log!(chat_tx,"[CHAT-HANDLER] failed to decrypt message from {}", src);
            return true;
        }
    };

    let chat_line = ChatLine::Message {
        ts: Local::now(),
        msg: decrypted.clone(),
    };
    let _ = chat_tx.send(chat_line);

    if server_mode {
        let peers = targets.lock().await.clone();
        let period = current_period_u32();
        let seq = CHAT_SEQ.fetch_add(1, Ordering::Relaxed);

        for peer in peers {
            if peer == src {
                continue;
            }

            let target_port = peer.port();
            let encrypted = match encrypt_for_port(secret_bytes, target_port, &decrypted) {
                Ok(ct) => ct,
                Err(e) => {
                    ui_log!(chat_tx,"[CHAT-HANDLER] encrypt {} failed: {}", peer, e);
                    continue;
                }
            };

            let msg_bytes = encrypted.as_bytes();
            let mut frame = Vec::with_capacity(16 + msg_bytes.len());
            write_header(&mut frame, Kind::Chat, period, seq, msg_bytes.len() as u32);
            frame.extend_from_slice(msg_bytes);

            if let Err(e) = send_via_shared(&shared_socket, &frame, peer).await {
                ui_log!(chat_tx,"[CHAT-HANDLER] send to {} failed: {}", peer, e);
            }
        }
    }
    true
}

pub async fn try_handle_ack(
    packet: UdpPacket,
    src_addr: SocketAddr,
    ack_map: Arc<DashMap<u32, Arc<Mutex<FileAck>>>>,
    channel_registry: AckChannelRegistry,
    registry: Arc<ProgressRegistry>,
    shared_socket: Arc<RwLock<Arc<UdpSocket>>>,
    targets: &Arc<Mutex<HashSet<SocketAddr>>>,
    chat_tx: broadcast::Sender<ChatLine>,
) -> bool {
    //ui_log!(chat_tx,"[ACK-HANDLER] from {} len={} bytes", src_addr, packet.payload.len());

    let mut ack = match AckPacket::from_bytes(&packet.payload) {
        Some(a) => a,
        None => {
            ui_log!(chat_tx,"[ACK-HANDLER] malformed from {}", src_addr);
            return false;
        }
    };

    // Normalize: use the addr we actually observed on this socket
    ack.src = src_addr;
    
    //ui_log!(chat_tx, "[DEBUG] Received ACK for file_id {}", ack.file_id);

    // --- Forward ACK into the correct sender-side channel ---
    if let Some(tx) = {
        let reg = channel_registry.read().await;
        reg.get(&ack.file_id).cloned()
    } {
		//ui_log!(chat_tx, "[DEBUG] Sending ACK to registered ack_tx...");
		
        tx.send(ack.clone());
        
		//ui_log!(chat_tx,"[ACK-HANDLER] forwarded ack: file_id={} chunk={} to send_file",ack.file_id, ack.chunk_index);
	}

    // --- Update ACK progress state using src_addr (now ack.src) ---
    let entry = ack_map.entry(ack.file_id).or_insert_with(|| {
        let peers_snapshot: Vec<SocketAddr> = {
            let lock = targets.blocking_lock();
            lock.iter().copied().collect()
        };
        Arc::new(Mutex::new(FileAck::with_token_and_peers(
            ack.transfer_token,
            &peers_snapshot,
            ack.total_chunks,
        )))
    });

    let mut fa = entry.lock().await;
    let total_chunks_now = fa.total_chunks;
    let chunk_index = ack.chunk_index;

    if !fa.per_client.contains_key(&ack.src) {
        let len = (total_chunks_now.max(chunk_index + 1)) as usize;
        let mut v = Vec::with_capacity(len);
        for _ in 0..len { v.push(AtomicBool::new(false)); }
        fa.per_client.insert(ack.src, v);
    }

    {
        let entry = fa.per_client.get_mut(&ack.src).unwrap();
        let need = (chunk_index as usize + 1).saturating_sub(entry.len());
        if need > 0 {
            entry.reserve(need);
            for _ in 0..need { entry.push(AtomicBool::new(false)); }
        }
    }

    fa.total_chunks = fa.total_chunks.max(chunk_index + 1);
    let entry = fa.per_client.get_mut(&ack.src).unwrap();
    let flag = &entry[chunk_index as usize];
    let was_new = !flag.swap(true, Ordering::Relaxed);

    if was_new {
        fa.total_unique_acks.fetch_add(1, Ordering::Relaxed);
        registry.update_progress(ack.file_id, fa.total_ack_count() as u64).await;
    }
    fa.last_addr = ack.src;

    // No echoing ACKs back to the senderâ€”removed.

    if (fa.total_ack_count() as u64) >= (fa.total_chunks * fa.per_client.len() as u64) {
        drop(fa);
        ack_map.remove(&ack.file_id);
        registry.remove(ack.file_id).await;
    }

    true
}



pub async fn try_handle_file_chunk(
    packet: UdpPacket,
    src: SocketAddr,
    shared_socket: Arc<RwLock<Arc<UdpSocket>>>,
    file_chunk_tx: &mpsc::Sender<FileChunk>,
    server_mode: bool,
    _registry: &Arc<ProgressRegistry>,
    forward_cache: &ForwardCache,
    ack_map: &AckMap,
    targets: &Arc<Mutex<HashSet<SocketAddr>>>,
    chat_tx: broadcast::Sender<ChatLine>,
) -> bool {

    let mut chunk = match FileChunk::from_bytes(&packet.payload) {
        Some(c) => c,
        None => {
            ui_log!(chat_tx,"[FILE-HANDLER] malformed FileChunk from {}", src);
            return false;
        }
    };
    
    chunk.src = Some(src);

    let file_map = forward_cache.entry(chunk.file_id).or_insert_with(DashMap::new);
    let is_new = file_map.insert(chunk.chunk_index, chunk.clone()).is_none();

    if server_mode {
        use dashmap::mapref::entry::Entry;
        if let Entry::Vacant(v) = ack_map.entry(chunk.file_id) {
            let peers_now: Vec<SocketAddr> = {
                let guard = targets.lock().await;
                guard.iter().copied().collect()
            };
            let total = chunk.total_chunks;
            let fa_struct = FileAck::new(src, targets.clone(), true).await;
            let fa = Arc::new(Mutex::new(fa_struct));
            {
                let mut fa_locked = fa.lock().await;
                fa_locked.transfer_token = chunk.transfer_token;
                fa_locked.total_chunks = total;
                for peer in peers_now {
                    let mut vec = Vec::with_capacity(total as usize);
                    for _ in 0..total {
                        vec.push(AtomicBool::new(false));
                    }
                    fa_locked.per_client.insert(peer, vec);
                }
            }
            v.insert(fa);
        }
    }

    let ack = AckPacket {
        file_id: chunk.file_id,
        chunk_index: chunk.chunk_index,
        transfer_token: chunk.transfer_token,
        src: {
            let sock = { shared_socket.read().await.clone() };
            sock.local_addr().unwrap_or_else(|_| "0.0.0.0:0".parse().unwrap())
        },
        total_chunks: chunk.total_chunks,
    };

    let ack_bytes = ack.to_bytes();
    let mut frame = Vec::with_capacity(16 + ack_bytes.len());
    let period = current_period_u32();
    let seq = FILE_SEQ.fetch_add(1, Ordering::Relaxed);
    write_header(&mut frame, Kind::FileAck, period, seq, ack_bytes.len() as u32);
    frame.extend_from_slice(&ack_bytes);

    if let Err(e) = send_via_shared(&shared_socket, &frame, src).await {
        ui_log!(chat_tx,"[FILE-HANDLER] ACK send error: {:?}", e);
    }

    if is_new {
        if let Err(e) = file_chunk_tx.send(chunk).await {
            ui_log!(chat_tx,"[FILE-HANDLER] FM broadcast failed: {:?}", e);
        }
    }

    true
}


